import React from 'react';
import './App.css';





class App extends React.Component {
  constructor(props) {
    super(props)
    this.state.list = ['Paython', 'Javascript', 'Ruby']
  }

  LangList(props) {
    return (
      <div>
         <ul> 
           <li>
             { props.list.map((e) => e)}
           </li>
         </ul>
      </div>
    )
  }

  render() {
    return (
      <div>

      </div>
    )
  }
}

export default App;
